import React from 'react';
import { 
    Box, 
    Container, 
    Grid, 
    Card, 
    CardContent,
    Typography,
    LinearProgress,
    IconButton,
    Avatar,
    Tooltip,
    Button,
    Divider
} from '@mui/material';
import AddIcon from '@mui/icons-material/Add';
import CalendarTodayIcon from '@mui/icons-material/CalendarToday';
import AssignmentIcon from '@mui/icons-material/Assignment';
import ChatIcon from '@mui/icons-material/Chat';
import AutoGraphIcon from '@mui/icons-material/AutoGraph';
import AssistantIcon from '@mui/icons-material/Assistant';
import TrendingUpIcon from '@mui/icons-material/TrendingUp';
import TimerIcon from '@mui/icons-material/Timer';
import EmojiEventsIcon from '@mui/icons-material/EmojiEvents';
import BarChartIcon from '@mui/icons-material/BarChart';
import { motion } from 'framer-motion';

function Dashboard() {
    const stats = [
        {
            title: "Study Streak",
            value: "7 days",
            icon: <EmojiEventsIcon sx={{ color: '#6366F1', fontSize: 24 }} />,
            progress: 70,
        },
        {
            title: "Focus Time",
            value: "4.5 hrs",
            icon: <TimerIcon sx={{ color: '#10B981', fontSize: 24 }} />,
            progress: 85,
        },
        {
            title: "Tasks Completed",
            value: "12/15",
            icon: <TrendingUpIcon sx={{ color: '#F59E0B', fontSize: 24 }} />,
            progress: 80,
        }
    ];

    return (
        <Box
            sx={{
                minHeight: '100vh',
                background: 'linear-gradient(180deg, #0F172A 0%, #1E293B 100%)',
                py: 4,
            }}
        >
            <Container maxWidth="xl">
                <Grid container spacing={3}>
                    {/* Stats Cards */}
                    {stats.map((stat, index) => (
                        <Grid item xs={12} md={4} key={index}>
                            <motion.div
                                initial={{ opacity: 0, y: 20 }}
                                animate={{ opacity: 1, y: 0 }}
                                transition={{ duration: 0.3, delay: index * 0.1 }}
                            >
                                <Card
                                    sx={{
                                        background: 'rgba(30, 41, 59, 0.8)',
                                        backdropFilter: 'blur(20px)',
                                        border: '1px solid rgba(148, 163, 184, 0.1)',
                                    }}
                                >
                                    <CardContent>
                                        <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
                                            {stat.icon}
                                            <Typography variant="h6" sx={{ ml: 1, color: '#CBD5E1' }}>
                                                {stat.title}
                                            </Typography>
                                        </Box>
                                        <Typography variant="h4" sx={{ mb: 2, color: '#F8FAFC' }}>
                                            {stat.value}
                                        </Typography>
                                        <LinearProgress 
                                            variant="determinate" 
                                            value={stat.progress}
                                            sx={{
                                                height: 6,
                                                borderRadius: 3,
                                                backgroundColor: 'rgba(148, 163, 184, 0.1)',
                                                '& .MuiLinearProgress-bar': {
                                                    borderRadius: 3,
                                                    background: 'linear-gradient(90deg, #6366F1, #818CF8)',
                                                },
                                            }}
                                        />
                                    </CardContent>
                                </Card>
                            </motion.div>
                        </Grid>
                    ))}

                    {/* Main Content Areas */}
                    <Grid item xs={12} md={8}>
                        <motion.div
                            initial={{ opacity: 0, y: -20 }}
                            animate={{ opacity: 1, y: 0 }}
                            transition={{ duration: 0.5 }}
                        >
                            <Card
                                sx={{
                                    mb: 4,
                                    background: 'rgba(17, 17, 17, 0.8)',
                                    backdropFilter: 'blur(20px)',
                                    borderRadius: 3,
                                    border: '1px solid rgba(255, 255, 255, 0.1)',
                                    boxShadow: '0 4px 20px rgba(0, 0, 0, 0.2)',
                                }}
                            >
                                <CardContent sx={{ p: 4 }}>
                                    <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
                                        <Typography variant="h4" sx={{ 
                                            display: 'flex', 
                                            alignItems: 'center', 
                                            gap: 2,
                                            color: 'rgba(255, 255, 255, 0.9)',
                                        }}>
                                            <ChatIcon sx={{ color: '#DC143C', fontSize: 40 }} />
                                            AI Study Assistant
                                        </Typography>
                                        <Button
                                            variant="contained"
                                            startIcon={<AssistantIcon />}
                                            sx={{
                                                bgcolor: 'rgba(220, 20, 60, 0.8)',
                                                '&:hover': { bgcolor: 'rgba(220, 20, 60, 1)' },
                                                fontSize: '1rem',
                                                px: 3,
                                                py: 1.5
                                            }}
                                        >
                                            Open Assistant
                                        </Button>
                                    </Box>
                                    <Divider sx={{ my: 3, bgcolor: 'rgba(255, 255, 255, 0.1)' }} />
                                    <Grid container spacing={4}>
                                        <Grid item xs={12} md={8}>
                                            <Typography variant="h6" color="rgba(255, 255, 255, 0.7)" gutterBottom>
                                                Current Study Plan
                                            </Typography>
                                            <Box sx={{ mt: 2 }}>
                                                {/* Study plan content will go here */}
                                            </Box>
                                        </Grid>
                                        <Grid item xs={12} md={4}>
                                            <Typography variant="h6" color="rgba(255, 255, 255, 0.7)" gutterBottom>
                                                Study Metrics
                                            </Typography>
                                            {/* Real-time metrics will go here */}
                                        </Grid>
                                    </Grid>
                                </CardContent>
                            </Card>
                        </motion.div>
                    </Grid>
                    <Grid item xs={12} md={4}>
                        <motion.div
                            initial={{ opacity: 0, x: 20 }}
                            animate={{ opacity: 1, x: 0 }}
                            transition={{ duration: 0.5, delay: 0.4 }}
                        >
                            <Card
                                sx={{
                                    height: '100%',
                                    background: 'rgba(17, 17, 17, 0.6)',
                                    backdropFilter: 'blur(20px)',
                                    borderRadius: 3,
                                    border: '1px solid rgba(255, 255, 255, 0.1)',
                                    boxShadow: '0 4px 20px rgba(0, 0, 0, 0.2)',
                                }}
                            >
                                <CardContent sx={{ height: '100%', p: 4 }}>
                                    <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
                                        <Typography variant="h5" sx={{ 
                                            display: 'flex', 
                                            alignItems: 'center', 
                                            gap: 1.5,
                                            color: 'rgba(255, 255, 255, 0.9)',
                                        }}>
                                            <AssignmentIcon sx={{ color: '#DC143C', fontSize: 30 }} />
                                            Task Manager
                                        </Typography>
                                        <Tooltip title="Add Task">
                                            <IconButton sx={{ color: '#DC143C' }}>
                                                <AddIcon />
                                            </IconButton>
                                        </Tooltip>
                                    </Box>
                                    {/* Task management interface will go here */}
                                </CardContent>
                            </Card>
                        </motion.div>
                    </Grid>
                    <Grid item xs={12} md={4}>
                        <motion.div
                            initial={{ opacity: 0, y: 20 }}
                            animate={{ opacity: 1, y: 0 }}
                            transition={{ duration: 0.5, delay: 0.6 }}
                        >
                            <Card
                                sx={{
                                    height: '100%',
                                    background: 'rgba(17, 17, 17, 0.6)',
                                    backdropFilter: 'blur(20px)',
                                    borderRadius: 3,
                                    border: '1px solid rgba(255, 255, 255, 0.1)',
                                    boxShadow: '0 4px 20px rgba(0, 0, 0, 0.2)',
                                }}
                            >
                                <CardContent sx={{ height: '100%', p: 4 }}>
                                    <Typography variant="h5" sx={{ 
                                        display: 'flex', 
                                        alignItems: 'center', 
                                        gap: 1.5,
                                        color: 'rgba(255, 255, 255, 0.9)',
                                        mb: 3
                                    }}>
                                        <AutoGraphIcon sx={{ color: '#DC143C', fontSize: 30 }} />
                                        Study Analytics
                                    </Typography>
                                    {/* Analytics dashboard will go here */}
                                </CardContent>
                            </Card>
                        </motion.div>
                    </Grid>
                </Grid>
            </Container>
        </Box>
    );
}

export default Dashboard;
